import React, { useEffect, useState } from 'react';
import '../CSS Sheets/ResultsPage.css';

interface ResultData {
    card: string;
    id: string;
    card_count: string;
    Ungraded: string;
    'Grade 1': string;
    'Grade 2': string;
    'Grade 3': string;
    'Grade 4': string;
    'Grade 5': string;
    'Grade 6': string;
    'Grade 7': string;
    'Grade 8': string;
    'Grade 9': string;
    'Grade 9.5': string;
    'SGC 10': string;
    'CGC 10': string;
    'PSA 10': string;
    'BGS 10': string;
    'BGS 10 Black': string;
    'CGC 10 Pristine': string;
    final_link: string;
    img_link: string;
}

const RESULTS_KEYS = [
    'card',
    'id',
    'card_count',
    'Ungraded',
    'Grade 1',
    'Grade 2',
    'Grade 3',
    'Grade 4',
    'Grade 5',
    'Grade 6',
    'Grade 7',
    'Grade 8',
    'Grade 9',
    'Grade 9.5',
    'SGC 10',
    'CGC 10',
    'PSA 10',
    'BGS 10',
    'BGS 10 Black',
    'CGC 10 Pristine',
    'final_link',
    'img_link',
] as const;

const ResultsPage: React.FC = () => {
    const [results, setResults] = useState<ResultData[]>([]);
    const [error, setError] = useState<string | null>(null);

    useEffect(() => {
        const fetchResults = async () => {
            try {
                const response = await fetch('http://localhost:8000/results');
                if (!response.ok) {
                    throw new Error('Failed to fetch results');
                }
                const data = await response.json();

                // Extract the results using the keys defined above
                const formattedResults: ResultData[] = data.results.card.map((_: string, index: number) => {
                    return RESULTS_KEYS.reduce((acc, key) => {
                        acc[key as keyof ResultData] = data.results[key][index];
                        return acc;
                    }, {} as ResultData);
                });

                setResults(formattedResults);
            } catch (err) {
                setError((err as Error)?.message || 'An unknown error occurred');
                console.error('Error fetching results:', err);
            }
        };

        fetchResults();
    }, []);

    const convertToCSV = (data: ResultData[], totals: any) => {
        const header = RESULTS_KEYS.map(key => {
            const formattedKey = key === 'card_count' ? 'Card Count' : key;
            return formattedKey.charAt(0).toUpperCase() + formattedKey.slice(1);
        }).join(',');

        const rows = data.map((item: ResultData) => 
            RESULTS_KEYS.map(key => item[key as keyof ResultData]).join(',')).join('\n');

        const totalsRow = [
            'Totals:',
            '',
            totals.card_count,
            `$${totals.Ungraded.toFixed(2)}`,
            ...RESULTS_KEYS.slice(3, 19).map(key => `$${totals[key as keyof ResultData].toFixed(2)}`),
            '',
        ].join(',');

        return `${header}\n${rows}\n${totalsRow}`;
    };

    const downloadCSV = () => {
        const totals = calculateTotals(results);
        const csvData = convertToCSV(results, totals);
        const blob = new Blob([csvData], { type: 'text/csv;charset=utf-8;' });
        const link = document.createElement('a');
        link.href = URL.createObjectURL(blob);
        link.setAttribute('download', 'results.csv');
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
    };

    const calculateTotals = (results: ResultData[]) => {
        const initialTotals = RESULTS_KEYS.reduce((acc, key) => {
            acc[key as keyof ResultData] = 0;
            return acc;
        }, {} as Record<string, number>);

        return results.reduce((totals, item) => {
            const count = parseInt(item.card_count) || 0;

            totals.card_count += count;

            RESULTS_KEYS.slice(3, 19).forEach(key => {
                totals[key as keyof ResultData] += (parseFloat(item[key].replace(/[^0-9.-]+/g, '')) || 0) * count;
            });

            return totals;
        }, initialTotals);
    };

    const totals = calculateTotals(results);

    return (
        <div className="results-page">
            <h1>Results</h1>
            {error && <p>Error: {error}</p>}
            <button onClick={downloadCSV} style={{ marginBottom: '20px' }} className="download-button">
                Download CSV
            </button>
            <table>
                <thead>
                    <tr>
                        <th>Card</th>
                        <th>ID</th>
                        <th>Card Count</th>
                        <th>Ungraded</th>
                        <th>Grade 1</th>
                        <th>Grade 2</th>
                        <th>Grade 3</th>
                        <th>Grade 4</th>
                        <th>Grade 5</th>
                        <th>Grade 6</th>
                        <th>Grade 7</th>
                        <th>Grade 8</th>
                        <th>Grade 9</th>
                        <th>Grade 9.5</th>
                        <th>SGC 10</th>
                        <th>CGC 10</th>
                        <th>PSA 10</th>
                        <th>BGS 10</th>
                        <th>BGS 10 Black</th>
                        <th>CGC 10 Pristine</th>
                        <th>Page Link</th>
                    </tr>
                </thead>
                <tbody>
                    {results.map((item, index: number) => (
                        <tr key={index}>
                            <td>
                                <span className="img-hover-link">
                                    {item.card}
                                    <span className="img-hover-tooltip">
                                        <img src={item.img_link} alt="Card" />
                                    </span>
                                </span>
                            </td>
                            <td>{item.id}</td>
